import axios from 'axios';
import { useEffect, useState } from 'react';
import './SideBar.css';

const SideBar = () => {
    const [cats, setCats] = useState([]);
    useEffect(() => {
        const getCats = async () => {
            const res = await axios.get("./categories");
            setCats(res.data)
        }
        getCats()
    },[])
    return (
        <div className="sidebar">
            <div className="sidebarItem">
                <span className="sidebarTitle">ABOUT ME</span>
                <img className="sideBarImg"
                    src="./images/sa.jpg" />
                <p className="aboutMe">Lorem ipsum dolor sit amet consectetur, adipisicing elit. Accusantium, blanditiis numquam nostrum consectetur corporis voluptatum facilis amet veniam at asperiores odit, quam, sit sunt esse ipsum commodi eos iusto! Et?</p>
            </div>
            <div className="sidebarItem">
                <span className="sidebarTitle">CATEGORIES</span>
                <ul className="sideBarList">
                    {cats.map(c=>{})}
                    <li className="sideBarListItems">Technology</li>
                    <li className="sideBarListItems">Philosophy</li>
                    <li className="sideBarListItems">Project</li>
                </ul>
            </div>
            <div className="sidebarItem">
                <span className="sidebarTitle">FOLLOW US</span>
                <div className="sideBarSocial">
                <i className="sideBar-icon fab fa-linkedin"></i>
                <i className="sideBar-icon fab fa-instagram"></i>
                <i className="sideBar-icon fab fa-github"></i>
                <i className="sideBar-icon fab fa-youtube"></i>
                </div>
            </div>
        </div>
    );
}

export default SideBar;
